    {
        padding: 0 0 0 8px;
    }
    &__grid-container
    {
        display: grid;
        grid-template-columns: repeat(2, 1fr);//no es necesario
        grid-template-rows: 15.75em repeat(2,181.99px);
        gap: 2em .7em;
    }
    &__grid-item
    {
        position: relative;
        border-radius: 1em;
        color: #183153;
        overflow: hidden;
        box-shadow: 0 .3em 0 0 rgb(195, 198, 209);
        border: 2px solid transparent;

