        font-size: 1.3em;
        left: 1em;
    }

    &__flex-container
    {
        display: flex;
        gap: 1.8em;
        margin-bottom: 1.8em;
    }
    &__flex-item
    {
        @extend .flex;
        flex: 1;
        position: relative;
        text-decoration: none;
        flex-direction: column;
        color: rgb(24 49 83);
        padding: 1.6em 1em 0 1em;
        min-height: 8.5em;
        border-radius: 1em;
        gap: .5em;
        background-color: #9c36b5;
        border: 2px solid transparent;

        &--blue
        {
           background-color: rgb(116 192 252);
           box-shadow: 0 .3em 0 0 rgb(20 110 190);

           &:hover
           {
               border: 2px solid rgb(20 110 190);
           }
        }
        &--pink
        {
            background-color:#e599f7;
            box-shadow: 0 .3em 0 0  #9c36b5;
            
            &:hover
            {
                border: 2px solid #9c36b5;
            }
        }
        &--red
        {
            background-color: #ff8787;
            box-shadow: 0 .3em 0 0 #e03131;
            
            &:hover
            {
                border: 2px solid #e03131;
            }
        }
        &--green
        {
            background-color: #63e6be;
            box-shadow: 0 .3em 0 0 #0ca678;
            
            &:hover
            {
                border: 2px solid #0ca678;
            }
        }
        &--purple
        {
            background-color: #b197fc;
            box-shadow: 0 .3em 0 0 #6741d9;
            
            &:hover
            {
                border: 2px solid #6741d9;
            }
        }
        &--white
        {
            background-color: #fff;
            box-shadow: 0 .3em 0 0 rgb(195, 198, 209);

            &:hover
            {
                border: 2px solid rgb(116, 192, 252);
                box-shadow: 0 .3em 0 0 rgb(116, 192, 252);
            }
        }
        &:active
        {
           @extend .button-animation;
           box-shadow: unset;
        }
    }
    &__flex-icon
    {
        font-size: 2em;
    }
    &__flex-title
    {
        display: block;
        text-align: center;
    }
    &__flex-new
    {
       display: block;
       position: absolute;
       font-size: 12px;
       text-transform: uppercase;
       left: 50%;
       top: 0;
       transform: translate(-50%,-50%);
       padding: .5em 1em;
       background-color: #fff;
       border-radius: 1em;
    }

    &__grid-container
    {
        display: grid;
        grid-template-columns: repeat(5, 1fr);
        grid-template-rows: minmax(min-content,max-content) minmax(min-content,max-content);
        gap: 1.8em 1.4em;
    }
    &__grid-item
    {
        position: relative;
        text-decoration: none;
        border-radius: .8em;
        overflow: hidden;
