        box-shadow: 0 0.3em 0 0 #c3c6d1;

        &--mob
        {
            display: none;
        }
        &::after
        {
            content: "";
            position: absolute;
            bottom: 0;
            left: 0;
            border: 55px solid transparent;
            border-right: 0;
            border-left: 250px solid #fff;
            z-index: 5;
            transform: translateY(-50%);
        }

        &--yellow
        {
           background-color: #ffd43b;

           &:hover
           {
              box-shadow: 0 0.3em 0 0 rgb(250, 176, 5);
           }
        }
        &--blue
        {
            background-color: #74c0fc;

