            {
               box-shadow: 0 0.3em 0 0 rgb(78, 165, 241);  
            }
        }
        &--last-one
        {
            @extend .flex;
            grid-column: 1 / span 5;

            &::after
            {
                content: "";
                position: absolute;
                bottom: 0;
                left: 0;
