@use '../util/extends';

.footer-block
{
    background-color: #183153;
    padding: 40px 0;
}
.footer
{ 
    width: 1536px;
    max-width: 100%;
    margin: 0 auto;
    padding: 0 32px;
    color: #fff;

    &__top-container
    {
        @extend .flex;
        align-items: flex-start;
    }
    &__section
    {
        flex: 0 1 40%;
        padding-right: 1em;
    }
    &__icon
    {
        font-size: 26px;
        margin-bottom: .8em;
    }
    &__title
    {
        margin-bottom: .5em;
    }
    &__description
    {
        font-size: 14px;
        margin-bottom: 1em;

        a
        {
            @extend .link;
            display: initial;
            color: #fff;
        }
    }
    &__aside
    {
        @extend .flex;
        flex: 1;
        align-items: flex-start;
        justify-content: right;
    }
    &__list
    {
        flex: 0 1 30%;
        padding: 0 1em;
    }
    &__item
    {
        margin-bottom: .5em;
        strong
        {
            color: rgb(95, 105, 125);
        }
    }
    &__link
    {
        @extend .link;
        color: #fff;
    }

    &__bottom-container
    {
        @extend .flex;
        justify-content: flex-end;
        gap: 2em;

        a
        {
            @extend .link;
            font-size: 14px;
            display: initial;
            color: #fff;
        }
        span
        {
            color: rgb(195, 198, 209);
            font-size: 14px;
        }
    }

}

@media only screen and (max-width:1148px) 
{
    .footer
    {
        width: 768px;

        & *, &__bottom-container a
        {
            font-size: 16px;
        }
        &__top-container
        {
            flex-direction: column;
            gap: 1em;
            margin-bottom: 1em;
        }

        &__aside
        {
            width: 100%;
        }
        &__list
        {
            flex: 1;
            padding: 0;
        }
    }
}

@media only screen and (max-width:767px) 
{
    .footer
    {
        & *:not(.footer__icon), &__bottom-container a
        {
            font-size: 12px;
        }
        &__bottom-container
        {
            gap: .5em;
        }
    }
}
